import React from 'react';

import { Switch, Route } from 'react-router-dom';
import Routes from './routes/index';

import NavigationBar from './layouts/Principal';

const App = () => (
  <div>
    <NavigationBar />
    <Switch>
      {Routes.map((route) => (
        <Route exact path={route.path} key={route.path}>
          <route.component />
        </Route>
      ))}
    </Switch>
  </div>
);

export default App;
